import React from 'react';
import Box from '../Box';

export default function Discord(){
    return(
        <div className='Discord'>
            <Box titulo='victorwsantos' informacao='#Follow me' imag='imagens/foto-curriculo.jpeg' />
            <a href='https://github.com/victorwsantos'><button>Follow</button></a>
        </div>
    )
}
